sys_variable_value.value:
(function execute(inputs, outputs) {
  /**
     As per Google,
     Role input should be in form roles/customName123.
     Project input can be anything
  **/

  var allowedPatternForRole = /^roles\/[^\/]+$/;
  if (!allowedPatternForRole.test(inputs.nameOfRole)) {
    throw new Error("Name of the role is in ^roles\/[^\/]+$ format : " + inputs.nameOfRole);
  } 
})(inputs, outputs);

